INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (126401, 1.47, 2, "クローチェ", 1, 10001, "2023/06/30 12:00:00", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", -470.0, 1, 0.0, 2002, 1, "2023/09/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (126401, 2.15, 1, "クローチェ", 2, 10002, "2023/06/30 12:00:00", "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", -470.0, 2, 0.0, 2002, 1, "2023/09/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (126501, 0.0, 2, "ライラエル", 1, 10003, "2023/06/30 12:00:00", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", -470.0, 2, 0.0, 2002, 1, "2023/09/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (126501, 0.0, 1, "ライラエル", 2, 10004, "2023/06/30 12:00:00", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", -470.0, 1, 0.0, 2002, 1, "2023/09/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (127702, 0.0, 2, "リンド", 1, 10005, "2023/09/15 15:00:00", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", -470.0, 2, 0.0, 2002, 2, "2023/12/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (127702, 0.0, 2, "リンド", 2, 10006, "2023/09/15 15:00:00", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", -470.0, 2, 0.0, 2002, 2, "2023/12/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (127802, 0.0, 1, "ヴルム", 1, 10007, "2023/09/15 15:00:00", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", -470.0, 1, 0.0, 2002, 2, "2023/12/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (127802, 6.5, 1, "ヴルム", 2, 10008, "2023/09/15 15:00:00", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", -470.0, 2, 0.0, 2002, 2, "2023/12/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (129602, 0.0, 1, "アネモネ", 1, 10009, "2023/12/15 15:00:00", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", -470.0, 2, 0.0, 2002, 3, "2024/03/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (129602, 0.0, 1, "アネモネ", 2, 10010, "2023/12/15 15:00:00", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", -470.0, 2, 0.0, 2002, 3, "2024/03/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (129701, 0.0, 1, "ネフィ=ネラ", 1, 10011, "2023/12/15 15:00:00", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", -470.0, 1, 0.0, 2002, 3, "2024/03/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (129701, 6.2, 1, "ネフィ=ネラ", 2, 10012, "2023/12/15 15:00:00", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", -470.0, 2, 0.0, 2002, 3, "2024/03/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (130301, 3.1, 5, "カノン", 1, 10013, "2024/03/15 15:00:00", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", -470.0, 3, 0.0, 2002, 4, "2024/06/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (130301, 6.15, 2, "カノン", 2, 10014, "2024/03/15 15:00:00", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", -470.0, 3, 0.0, 2002, 4, "2024/06/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (130401, 0.0, 2, "ナーナ", 1, 10015, "2024/03/15 15:00:00", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", -470.0, 2, 0.0, 2002, 4, "2024/06/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (130401, 3.35, 1, "ナーナ", 2, 10016, "2024/03/15 15:00:00", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", -470.0, 2, 0.0, 2002, 4, "2024/06/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (130502, 0.0, 1, "ホウオウ", 1, 10017, "2024/06/15 15:00:00", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", -470.0, 1, 0.0, 2002, 5, "2024/09/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (130502, 3.18, 1, "ホウオウ", 2, 10018, "2024/06/15 15:00:00", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", -470.0, 2, 0.0, 2002, 5, "2024/09/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (130503, 0.0, 4, "ホウオウ", 3, 10019, "2024/06/15 15:00:00", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", -470.0, 4, 0.0, 2002, 5, "2024/09/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (123301, 4.9, 2, "ネア", 1, 10020, "2024/06/15 15:00:00", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", -470.0, 1, 0.0, 2002, 5, "2024/09/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (123301, 4.8, 2, "ネア", 2, 10021, "2024/06/15 15:00:00", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", -470.0, 1, 0.0, 2002, 5, "2024/09/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (133301, 4.922, 1, "カリザ", 1, 10022, "2024/09/15 15:00:00", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", -470.0, 3, 0.0, 2002, 6, "2024/12/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (133301, 9.638, 5, "カリザ", 2, 10023, "2024/09/15 15:00:00", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", -470.0, 3, 0.0, 2002, 6, "2024/12/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (133401, 2.88, 2, "ミーア", 1, 10024, "2024/09/15 15:00:00", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", -470.0, 1, 0.0, 2002, 6, "2024/12/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (133401, 4.818, 1, "ミーア", 2, 10025, "2024/09/15 15:00:00", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", -470.0, 5, 0.0, 2002, 6, "2024/12/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (133002, 1.78, 1, "グレイス", 1, 10026, "2024/12/15 15:00:00", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", -470.0, 2, 0.0, 2002, 7, "2025/03/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (133002, 6.15, 7, "グレイス", 2, 10027, "2024/12/15 15:00:00", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", -470.0, 1, 0.0, 2002, 7, "2025/03/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (133102, 4.28, 2, "ヴァイオレット", 1, 10028, "2024/12/15 15:00:00", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", -470.0, 6, 0.0, 2002, 7, "2025/03/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (133102, 0.0, 1, "ヴァイオレット", 2, 10029, "2024/12/15 15:00:00", "じめじめした商品は\nございませんので\n安心してお買い求め下さい", -470.0, 1, 0.0, 2002, 7, "2025/03/22 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (136902, 5.53, 1, "ルルィ", 1, 10030, "2025/03/15 15:00:00", "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", -470.0, 2, 0.0, 2002, 8, "2025/06/23 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (136902, 6.05, 7, "ルルィ", 2, 10031, "2025/03/15 15:00:00", "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", -470.0, 9, 0.0, 2002, 8, "2025/06/23 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (137001, 0.0, 1, "デュラン", 1, 10032, "2025/03/15 15:00:00", "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", -470.0, 2, 0.0, 2002, 8, "2025/06/23 14:59:59");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (137001, 0.0, 1, "デュラン", 2, 10033, "2025/03/15 15:00:00", "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", -470.0, 2, 0.0, 2002, 8, "2025/06/23 14:59:59");
